            design_is_change: false,
            option_is_change: false,
            isLoadingData: false,
            sub_menu_key: ['design_menu'],
            closeMakeSure: false,
            closeMakeSureProductGroup: false,
            is_has_plan_collection: false,
            is_has_plan_product_groups: false
        }
    },
    methods: {
        returnPaidFeatureVariable(is_has_plan_collection, is_has_plan_product_groups) {
            this.is_has_plan_collection = is_has_plan_collection
            this.is_has_plan_product_groups = is_has_plan_product_groups
        },
        read_params: function () {
            var url = window.location.href
            if (url.includes('?')) {
                var search = window.location.search
                var params = Object.fromEntries(new URLSearchParams(search))
            } else {
                params = {}
            }
            if ('plan_register' in params) {
                this.currentPage = 'plans_billing'
                delete params['plan_register']
            }
            if ('error' in params) {
                this.show_toast('error', params['error'])
                delete params['error']
            }
            if ('message' in params) {
                this.show_toast('success', params['message'])
                delete params['message']
            }

        },
        setCloseMakeSureProductGroup() {
            this.closeMakeSureProductGroup = true
        },
        setCloseMakeSure() {
            this.closeMakeSure = true
        },
        setLoadingData(state) {
            this.isLoadingData = state
        },
        checkOptionChange(status) {
            this.option_is_change = status
        },
        setChangeDesignSettingStatus(status) {
            this.design_is_change = status
        },
        show_toast: function (type, message, duration = 2) {
            let background = ''
            if (type === 'success') {
                background = '#52c41a'
            } else if (type === 'error') {
                background = '#F5222D'
            } else {
                background = '#E9A317'
            }
            notification[type]({
                message: message,
                duration: duration,
                placement: 'bottomRight',
                style: {
                    backgroundColor: background,
                }
            })
        },
        changePage(targetPage, designItemName) {
            if (!this.design_is_change && !this.option_is_change) {
                this.currentPage = targetPage
                if (designItemName) {
                    this.designItemName = designItemName
                } else {
                    this.designItemName = ''
                }
            }
            if (this.design_is_change || this.option_is_change) {
                this.show_toast("warning", 'Please "Save" or "Discard" before changing page!', 2)
            }
            if (targetPage === 'options'){
                this.trigger_crisp('nsvariant_option_configuration')
            }
        },
        trigger_crisp: function (event) {
            $crisp.push(["set", "session:event", [event]])
        },

    }
}
</script>